import { RouterProvider, createBrowserRouter } from "react-router-dom";
import Questions from "./pages/Questions";
import Account from "./pages/Account";
import Answers from "./pages/Answers";
import NewQuestion from "./pages/NewQuestion";
import QuestionEdit from "./pages/QuestionEdit";
import RootLayout from "./pages/Root";
import QuestionsRootLayout from "./pages/QuestionsRoot";

const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
    children: [
      { index: true, element: <Account /> },
      {
        path: "questions",
        element: <QuestionsRootLayout />,
        children: [
          { index: true, element: <Questions /> },
          { path: ":questionId", element: <Answers /> },
          { path: "new", element: <NewQuestion /> },
          { path: ":questionId/edit", element: <QuestionEdit /> },
        ],
      },
    ],
  },
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
